begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(308860686152130885)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'INTLTELINPUT_WWW.JQUERYSCRIPT.NET'
,p_display_name=>'phone'
,p_supported_ui_types=>'DESKTOP'
,p_supported_component_types=>'APEX_APPLICATION_PAGE_ITEMS'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'function render_phone (',
'    p_item                in apex_plugin.t_page_item,',
'    p_plugin              in apex_plugin.t_plugin,',
'    p_value               in varchar2,',
'    p_is_readonly         in boolean,',
'    p_is_printer_friendly in boolean )',
'    RETURN APEX_PLUGIN.t_page_item_render_result ',
'is',
'l_result           APEX_PLUGIN.T_PAGE_ITEM_RENDER_RESULT;',
'l_escaped_value varchar2(32767) := sys.htf.escape_sc(p_value);',
'l_name varchar2(50);',
'begin',
'',
'l_name := apex_plugin.get_input_name_for_page_item(false);',
'',
'htp.p(''<input type="text" id="p_''||p_item.name||''" class="text_field" value="''||p_value||''">'');',
'htp.p(''<input type="text" id="''||p_item.name||''" value="" name="''||l_name||''">'');',
'',
'-- Register the conversion from div to slider to execute when the page is loaded ',
'',
'APEX_JAVASCRIPT.add_library(p_name           => ''intlTelInput.min'',',
'                                p_directory      => p_plugin.file_prefix,',
'                                p_version        => NULL,',
'                                p_skip_extension => false);',
'  apex_css.add_file (',
'    p_name => ''intlTelInput'',',
'    p_directory => p_plugin.file_prefix',
');',
'    ',
'  -- using our newly created attribute values',
'',
'apex_javascript.add_onload_code (p_code => ''telInput = $("#p_''||p_item.name||''");',
'  telInput.after(''''<span id="valid-msg" class="hide">Valid</span> <span id="error-msg" class="hide">Invalid number</span>'''');',
'  errorMsg = $("#error-msg");',
'  validMsg = $("#valid-msg");',
'  $("#''||p_item.name||''").hide();',
'  telInput.intlTelInput({',
'  allowExtensions: true,',
'  formatOnDisplay: true,',
'  autoFormat: true,',
'  autoHideDialCode: true,                             ',
'  autoPlaceholder: true,',
'  defaultCountry: "auto",',
'  ipinfoToken: "yolo",',
'  nationalMode: false,',
'  numberType: "MOBILE",',
'  preferredCountries: [''''sa'''', ''''ae'''', ''''qa''''],',
'  preventInvalidNumbers: true,',
'  separateDialCode: true,',
'  initialCountry: "auto",',
'  geoIpLookup: function(callback) {',
'  $.get("https://ipinfo.io", function() {}, "jsonp").always(function(resp) {',
'    var countryCode = (resp && resp.country) ? resp.country : "971";',
'    callback(countryCode);',
'  });',
'},',
'      utilsScript: "https://cdnjs.cloudflare.com/ajax/libs/intl-tel-input/11.0.9/js/utils.js",',
'      dropdownContainer: "body"',
'  });',
'',
'  var reset = function() {',
'  telInput.removeClass("error");',
'  errorMsg.addClass("hide");',
'  validMsg.addClass("hide");',
'  };',
'//  reset();',
'                                 ',
'                                 $( "#addr" ).click(',
'',
'  function() {',
'    reset();',
'    if ($.trim(telInput.val())) {',
'      if (telInput.intlTelInput("isValidNumber")) {',
'          validMsg.removeClass("hide");',
'          $s("''||p_item.name||''",telInput.intlTelInput("getNumber"));',
'          telInput.css("background-color", "white");',
'    } else {',
'          errorMsg.removeClass("hide");',
'          telInput.css("background-color", "yellow");',
'          telInput.addClass("error");',
'          $s("''||p_item.name||''",telInput.val());',
'//          $s("p_''||p_item.name||''",telInput.intlTelInput("getNumber"));',
'          return false;                       ',
'            }',
'     }',
'   }',
'                                 );',
'                                 ',
'                                 ',
'telInput.blur(function() {',
'    reset();',
'    if ($.trim(telInput.val())) {',
'      if (telInput.intlTelInput("isValidNumber")) {',
'          validMsg.removeClass("hide");',
'          $s("''||p_item.name||''",telInput.intlTelInput("getNumber"));',
'          telInput.css("background-color", "white");',
'    } else {',
'          errorMsg.removeClass("hide");',
'          telInput.css("background-color", "yellow");',
'          telInput.addClass("error");',
'          $s("''||p_item.name||''",telInput.val());',
'//          $s("p_''||p_item.name||''",telInput.intlTelInput("getNumber"));',
'          return false;                       ',
'            }',
'     }',
'   });                                 ',
'',
'   telInput.on("keyup change", reset);''',
');',
'return (l_result);',
'',
'end;',
'',
'function phone_validate (',
'    p_item   in apex_plugin.t_page_item,',
'    p_plugin in apex_plugin.t_plugin,',
'    p_value  in varchar2 )',
'    return apex_plugin.t_page_item_validation_result',
'is',
'    v_return apex_plugin.t_page_item_validation_result;',
'begin',
'    if p_value is not null and substr(p_value,1,1)!=''+'' then',
'	  v_return.message :=''Invalid Cell Phone Number!'';',
'--      if p_value is not null then',
'--         :p_item.name :=null;',
'--      end if;',
'	end if;',
'	return v_return;',
'end;'))
,p_api_version=>1
,p_render_function=>'render_phone'
,p_validation_function=>'phone_validate'
,p_standard_attributes=>'VISIBLE:FORM_ELEMENT:SESSION_STATE:SOURCE:ELEMENT:WIDTH:PLACEHOLDER'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_version_identifier=>'1.0'
,p_files_version=>6
);
end;
